Goddess makeup takes a great deal of effort and leads to more creativity. As a next stage in goddess makeup, here I have recreated the look of Sri Prathyangira Devi using prosthetics with molding, casting and special cosmetic effects. This is a preview of what we are gonna learn in our upcoming Goddess Makeup class in Chennai on Jan 10th. Hope you all like this special effect makeup! Prosthetics makeup is not just for goddess but would also help you learn more special effect makeups.See u all at Chennai Goddess class on Jan10th. Thanks again for your love and support!!!

